import React from "react";

export default function Taskdone()
{
    return <div className="container-fluid">
         <div className="row">
             <div className="offset-4 col-4 task-done">
                 <h1 className="anim">congratulation's you done it</h1>
                 </div>
             </div>
        </div>
}
